    <defs>
      <path id="sd8bd4f91" d="M0-1L.588.809-.952-.309H.952L-.588.809z" fill="#ffde00" />
    </defs>
    <path fill="#de2910" d="M0 0h30v20H0z" />
    <use xlinkHref="#sd8bd4f91" transform="matrix(3 0 0 3 5 5)" />
    <use xlinkHref="#sd8bd4f91" transform="rotate(23.036 .093 25.536)" />
    <use xlinkHref="#sd8bd4f91" transform="rotate(45.87 1.273 16.18)" />
    <use xlinkHref="#sd8bd4f91" transform="rotate(69.945 .996 12.078)" />
    <use xlinkHref="#sd8bd4f91" transform="rotate(20.66 -19.689 31.932)" />
  </svg>
);

export default FlagCn;
